    <div className="container">
        <h4 className="center">Announcement</h4>

        <form id="text">
            <Form.Group controlId="exampleForm.ControlSelect1">
            <Form.Control as="select">
            <option id="Textpage">Text</option>
            <option id="Imagepage">Image</option>
            </Form.Control>
            </Form.Group>
        </form>


        <div>Title</div>
        <div>Desc</div>
        <div>Image uRL:</div>
        <button>Send Announcement</button>
        </div>
    );
    }
}
